import './App.css';
import mePhoto from './meimg.jpg';


// getting data from json file
let bio = document.getElementById('aboutme');

fetch(bionote)
  .then((data) => data.json())
  .then(thedata => bio.innerHTML = thedata.Aboutme);




function App() {
  return (
    <div className="App">
      {/* head */}
      <div id="heads">

        <div>
          <h1>[-]</h1>
        </div>

        <div id="links">
          <span> <h3>Games</h3></span>
          <span> <h3>Music</h3></span>
          <span> <h3>Other Links</h3></span>
        </div>

      </div>

      {/* body */}
      <div id="body">
        <div>
          <img src={mePhoto} alt={'me photo'} />
        </div>
        <div>
          <p id="aboutme">This has a bio to it</p>
        </div>
      </div>

      {/* footer */}
      <div id="footer">
        <span> <h1>[-]</h1></span>
        <span>
          <p>Instagram</p>
          <p>LinkedIn</p>
          <p>Twitter</p>
        </span>
        <span> <p>Tic Tac Toe</p></span>
      </div>

    </div>
  );
}

export default App;
